const Content = (props) => {
    const name = "현규";
    return (
        <div>
            <h1>Content</h1>
            {name === "현규" ? <div>{name}</div> : <div>false</div>}
            <div>{props.num}</div>
        </div>
    );
}

const Header = () => {
    const num = 32;
    return (
        <h1>
            <div>Title</div>
            <Content num = {num}/>
        </h1>
    );
};

const App = () => {
    return (
        <div>
            <h3>aaa</h3>
            <Header />
        </div>
    );
};

export default App;
